%[text] ## Solver
clear
% Starting values:
BusDeclaration;
q0 = [0, 0.4, 4.10, -0.88];
dq0 = [0,-0.05,0,0];
X0 = [q0, dq0];
Sim.time = 1;
tspan = [0 Sim.time];
options = odeset('RelTol',1e-6, 'AbsTol',1e-6);
tic

Animate = 0; % 1 = fanimate, 2 = drawnow
% % Params set here
% VLcmd.r_des = 0.45;
% VLcmd.dr_des = 0;
