% VLcmd.KPth = 150;
% VLcmd.KDth = 10;
% VLcmd.Tff =0;



% Using ode45
sols = ode113(@(t, X) halfleka_dynamics(t, X), tspan, X0, options); %[output:05eaa871]
toc %[output:7e5dcbff]

% Import important coords
BalekaParams

l1 = UpperLink.l;
l2 = FootLink.l2;
l3 = LowerLink.l;
l4 = FootLink.l4;
l5 = HalfBody.l;
foot_offset = FootLink.offset;
th3 = FootLink.th3;

clear FootLink LowerLink HalfBody UpperLink % declutter workspace

%%
%[text] ## Display generalized Coordinates
% display state of all variables
plot(sols.x,sols.y(1,:)); %[output:84bc8a29]
hold on %[output:84bc8a29]
plot(sols.x,sols.y(2,:)); %[output:84bc8a29]
plot(sols.x,sols.y(3,:)); %[output:84bc8a29]
plot(sols.x,sols.y(4,:)); %[output:84bc8a29]
legend('x','y','th1','th2'); %[output:84bc8a29]
title("Generalised Coordinates"); %[output:84bc8a29]
xlabel('time (s)'); %[output:84bc8a29]
hold off %[output:84bc8a29]

% display derivative state of all variables
plot(sols.x,sols.y(5,:)); %[output:98e2e4aa]
hold on %[output:98e2e4aa]
plot(sols.x,sols.y(6,:)); %[output:98e2e4aa]
plot(sols.x,sols.y(7,:)); %[output:98e2e4aa]
plot(sols.x,sols.y(8,:)); %[output:98e2e4aa]
legend('dx','dy','dth1','dth2'); %[output:98e2e4aa]
title("Derivative of Generalised Coordinates"); %[output:98e2e4aa]
xlabel('time (s)'); %[output:98e2e4aa]
hold off %[output:98e2e4aa]
%%
%[text] ## Forces
coords_total = zeros(8, length(sols.x));

foot_total = zeros(4,length(sols.x));
grf_total = zeros(2,length(sols.x));


Controller_total = zeros(7, length(sols.x));
constraint_total = zeros(6,length(sols.x));
Controller_total(7, :) = repmat(States.Contact,1, length(sols.x));
damping_total = zeros(2, length(sols.x));

Mddq_total = zeros(6, length(sols.x));
C_total = zeros(6, length(sols.x));
G_total = zeros(6, length(sols.x));
Hl_total = zeros(6, length(sols.x));
J_total = zeros(6, length(sols.x));

for i = 1:length(sols.x)
    % States
    coords_total(:, i) = sols.y(1:8, i);
    
    ph1 = ph1_calc(sols.y(3,i),sols.y(4,i));
    dph1 = dph1_calc(sols.y(3,i),sols.y(4,i),sols.y(7,i),sols.y(8,i));
    ph2 = ph2_calc(sols.y(3,i),sols.y(4,i));
    dph2 = dph2_calc(sols.y(3,i),sols.y(4,i),sols.y(7,i),sols.y(8,i));
    th1 = sols.y(3, i);
    th2 = sols.y(4, i);
    dth1 = sols.y(7, i);
    dth2 = sols.y(8, i);
    dx = sols.y(5, i);
    dy = sols.y(6, i);
    q = [sols.y(1, i); sols.y(2, i); sols.y(3, i); sols.y(4, i); ph1; ph2];
    dq = [sols.y(5, i); sols.y(6, i); sols.y(7, i); sols.y(8, i); dph1; dph2];
    
    % feet
    foot_dynamics = foot_Func(q, dq);
    foot_total(:,i) = reshape(foot_dynamics, [4, 1]);
    
    %GRF
    grf_total(:, i) = grf_calc(foot_dynamics);
    t = Hopping(th1, th2, dth1, dth2, foot_dynamics(2, 1), sols.x(i), dx, dy);
    t1 = t(1);
    t2 = t(2);
    F_c = constraint_Func(q, dq, t1, t2, grf_total(:,i));
    Hl_total(:, i) = Ht_calc_func(q)*F_c;
    J_total(:, i) = J_calc_func(q)*grf_total(:, i);

 
    ddq = accel_Func(q, dq, t1, t2, F_c, grf_total(:,i));
    Mddq_total(:, i) = M_calc_func(q)*ddq;
    C_total(:,i) = C_calc_func(q, dq);
    G_total(:,i) = G_calc_func(q);
    

    
    Controller_total(:, i) = Hopping(th1, th2, dth1, dth2, foot_dynamics(2, 1), sols.x(i), dx, dy);
    % constraint_total(:,i) = constraint_Func(x,y,th1,th2,ph1_sols,ph2_sols,dx,dy,dth1,dth2,dph1_sols,dph2_sols,t(1),t(2),grf_t,grf_n);
end
extra_terms_total = Mddq_total  + C_total + G_total - Hl_total - J_total;
