plot(sols.x(ts:end), extra_terms_total(2, ts:end)) %[output:9a406183]
plot(sols.x(ts:end), extra_terms_total(3, ts:end)) %[output:9a406183]
plot(sols.x(ts:end), extra_terms_total(4, ts:end)) %[output:9a406183]
plot(sols.x(ts:end), extra_terms_total(5, ts:end)) %[output:9a406183]
plot(sols.x(ts:end), extra_terms_total(6, ts:end)) %[output:9a406183]
