hold off %[output:9a406183]

plot(sols.x(ts:end), Mddq_total(3,ts:end)) %[output:09b50487]
hold on %[output:09b50487]
plot(sols.x(ts:end), C_total(3,ts:end)) %[output:09b50487]
plot(sols.x(ts:end), G_total(3,ts:end)) %[output:09b50487]
plot(sols.x(ts:end), -Hl_total(3,ts:end)) %[output:09b50487]
legend('Mddq', 'C', 'G', '-Hl') %[output:09b50487]
title('Comparison of th1 torques') %[output:09b50487]
hold off %[output:09b50487]
% hold off
% plot(sols.x,foot(4,:));
