%[text] ## Load into Simulink
time = sols.x;

coords_sols.time = transpose(time);
coords_sols.signals.values = transpose(coords_total);

forces_val = [grf_total;foot_total;damping_total];
forces_sols.time = transpose(time);
forces_sols.signals.values = transpose(forces_val);

cmd_sols.time = transpose(time);
cmd_sols.signals.values = transpose(Controller_total);

% sim("data_inspector_Baleka.slx");
%%
%[text] ## Animate (fanimate)
if Animate ==1
    x_sim = @(t) deval(sols, t, 1);
    y_sim = @(t) deval(sols, t, 2);
    th1_sim = @(t) deval(sols, t, 3);
    th2_sim = @(t) deval(sols, t, 4);
    
    ph1_sim = @(t) ph1_calc(th1_sim(t), th2_sim(t));
    ph2_sim = @(t) ph2_calc(th1_sim(t), th2_sim(t));
    
    x_hip_left = @(t) x_sim(t) - l5/2; % y same as body
    x_hip_right = @(t) x_sim(t) + l5/2; % y same as body
    
    x_knee_left = @(t) x_hip_left(t) + l1*cos(th1_sim(t));
    y_knee_left = @(t) y_sim(t) + l1*sin(th1_sim(t));
    
    x_knee_right = @(t) x_hip_right(t) + l1*cos(th2_sim(t));
    y_knee_right = @(t) y_sim(t) + l1*sin(th2_sim(t));
    
    x_joint_left = @(t) x_knee_left(t) + l2*cos(ph1_sim(t) + th1_sim(t)); % calculated from left leg segment
    y_joint_left = @(t) y_knee_left(t) + l2*sin(ph1_sim(t) + th1_sim(t)); % calculated from left leg segment
    
    x_joint_right = @(t) x_knee_right(t) + l3*cos(ph2_sim(t) + th2_sim(t)); 
    y_joint_right = @(t) y_knee_right(t) + l3*sin(ph2_sim(t) + th2_sim(t)); 
    
    x_foot = @(t) x_joint_left(t) + l4*cos(ph1_sim(t) + th1_sim(t) + th3);
    y_foot = @(t) y_joint_left(t) + l4*sin(ph1_sim(t) + th1_sim(t) +th3) + foot_offset;
    fanimator(@(t) plot(x_sim(t), y_sim(t), 'b*'), 'AnimationRange',tspan, 'FrameRate',60);
    axis equal;
    pbaspect([1 0.2 1]);
    axis([-2 2 -0.2 1]);
    hold on;
    fanimator(@(t) plot([x_hip_left(t) x_knee_left(t)], [y_sim(t), y_knee_left(t)], 'r-'), 'AnimationRange',tspan, 'FrameRate',60);
    fanimator(@(t) plot([x_hip_right(t) x_knee_right(t)], [y_sim(t), y_knee_right(t)], 'r-'), 'AnimationRange',tspan, 'FrameRate',60);
    
    fanimator(@(t) plot([x_knee_left(t) x_joint_left(t)], [y_knee_left(t) y_joint_left(t)], 'r-'), 'AnimationRange',tspan, 'FrameRate',60);
    fanimator(@(t) plot([x_knee_right(t) x_joint_right(t)], [y_knee_right(t) y_joint_right(t)], 'r-'), 'AnimationRange',tspan, 'FrameRate',60);
    
    fanimator(@(t) plot([x_joint_left(t) x_foot(t)], [y_joint_left(t) y_foot(t)], 'b-'), 'AnimationRange',tspan, 'FrameRate',60);
    hold off;
    % writeAnimation("HalfLeka_Hop.gif",'framerate',60);
    % vidObj = VideoWriter('HalfLeka_Drop','MPEG-4');
    % open(vidObj)
    % writeAnimation(vidObj,'framerate',60, 'SpeedFactor', 0.1)
    % close(vidObj)
    playAnimation('SpeedFactor', 0.1)
end
%%
%[text] ## Animate (drawnow)
if Animate ==2
    fps = 30; % Desired frame rate
    dt = 1 / fps; % Time interval between frames
    t_interp = sols.x(1):dt:sols.x(end); % New time vector
    
    % Interpolate all states in sols.y
    solsy_interp = interp1(sols.x, sols.y', t_interp, 'linear')';
    
    
    x_sim = solsy_interp(1,:);
    y_sim = solsy_interp(2,:);
    th1_sim = solsy_interp(3,:);
    th2_sim = solsy_interp(4,:);
    ph1_sim =ph1_calc(th1_sim, th2_sim);
    ph2_sim = ph2_calc(th1_sim, th2_sim);
    
    x_hip_left =x_sim - l5/2; % y same as body
    x_hip_right = x_sim + l5/2; % y same as body
    
    
    x_knee_left = x_hip_left + l1*cos(th1_sim);
    y_knee_left = y_sim + l1*sin(th1_sim);
    
    x_knee_right = x_hip_right + l1*cos(th2_sim);
    y_knee_right = y_sim + l1*sin(th2_sim);
    
    x_joint_left = x_knee_left + l2*cos(ph1_sim + th1_sim); % calculated from left leg segment
    y_joint_left = y_knee_left + l2*sin(ph1_sim + th1_sim); % calculated from left leg segment
    
    x_joint_right = x_knee_right + l3*cos(ph2_sim + th2_sim); 
    y_joint_right = y_knee_right + l3*sin(ph2_sim + th2_sim); 
    
    x_foot = x_joint_left + l4*cos(ph1_sim + th1_sim + th3);
    y_foot = y_joint_left + l4*sin(ph1_sim + th1_sim +th3) + foot_offset;
    fig = figure;
    
    ax = axes('Parent',fig);
    
    b = animatedline(ax,'Color','b','LineWidth',1, "Marker", "*");
    u_l = animatedline(ax,'Color','r','LineWidth',0.5);
    u_r = animatedline(ax,'Color','r','LineWidth',0.5);
    l_l = animatedline(ax,'Color','r','LineWidth',0.5);
    l_r = animatedline(ax,'Color','r','LineWidth',0.5);
    f = animatedline(ax,'Color','r','LineWidth',0.5);
    
    axes(ax);
    
    axis equal;
    axis(ax,[(x_sim(1)-1) (x_sim(1)+1) -0.5 1]);
    
    hold on;
    tic
    drawnow
    
    for i = 1:length(solsy_interp)
    
        clearpoints(b);
        clearpoints(u_l);
        clearpoints(u_r);
        clearpoints(l_l);
        clearpoints(l_r);
        clearpoints(f);
    
        % axis equal;
        % axis([-1 11 -0.5 1]);
        % body
        addpoints(b,x_sim(i),y_sim(i));
        % upper left
        addpoints(u_l,[x_hip_left(i), x_knee_left(i)],[y_sim(i), y_knee_left(i)]);
        % upper right
        addpoints(u_r,[x_hip_right(i), x_knee_right(i)],[y_sim(i), y_knee_right(i)]);
        % lower left
        addpoints(l_l,[x_knee_left(i), x_joint_left(i)],[y_knee_left(i), y_joint_left(i)]);
        % lower right
        addpoints(l_r,[x_knee_right(i), x_joint_right(i)],[y_knee_right(i), y_joint_right(i)]);
        % foot
        addpoints(f,[x_joint_left(i), x_foot(i)],[y_joint_left(i), y_foot(i)]);
    
        axis(ax,[(x_sim(i)-1) (x_sim(i)+1) -0.1 1]);
    
        drawnow
        pause(dt);
    
    end
    drawnow
    toc
    hold off;
end

