%[text] ## Functions
function out = halfleka_dynamics(time, q)
    persistent ddq F_c t1 t2
    if isempty(ddq)
        ddq = [0,0,0,0,0,0];
        F_c = [0,0];
        t1 = 0;
        t2 = 0;
    end

    th1 = q(3);
    th2 = q(4);
    dx = q(5);
    dy = q(6);
    dth1 = q(7);
    dth2 = q(8);


    % Calculate ph1 and ph2
    ph1 = ph1_calc(th1, th2);
    dph1 = dph1_calc(th1, th2, dth1, dth2);
    ph2 = ph2_calc(th1, th2);
    dph2 = dph2_calc(th1, th2, dth1, dth2);
    
    % Create state vectors
    dq = [q(5), q(6), q(7), q(8), dph1, dph2];
    q = [q(1), q(2), q(3), q(4),ph1, ph2];

    % Foot dynamics
    foot_dynamics = foot_Func(q, dq);

    GRF = grf_calc(foot_dynamics);
    
    % controller:
    t = Hopping(th1, th2, dth1, dth2, foot_dynamics(2, 1), time, dx, dy);
    t1 = t(1);
    t2 = t(2); 
    
    
    % calculate constraint force
    F_c = constraint_Func(q, dq, t1, t2, GRF);
    % Acceleration of the system
    ddq = accel_Func(q, dq, t1, t2, F_c, GRF);

   

    out = zeros(8, 1);
    out(1) = dx; out(2) = dy; out(3) = dth1; out(4) = dth2;
    out(5:8) = ddq(1:4);
persistent threshold;
    if (time == 0)
        threshold = 0;
    end

    if (time>threshold)
        if (threshold == 0)
            fprintf("Time = %.4f",time);
        else
            if (time<=10)
                fprintf("\b\b\b\b\b\b%.4f",time);
            else
                fprintf("\b\b\b\b\b\b\b%.4f",time);
            end
        end
        threshold = threshold + 0.001;
    end
end

